import React from 'react';
import QuizCard from './components/QuizCard';

function Home() {
    const quizzes = [
        {
            title: 'JavaScript Basics',
            image: 'https://example.com/js-basics.jpg',
            description: 'Test your knowledge of basic JavaScript concepts.',
        },
        {
            title: 'React Fundamentals',
            image: 'https://example.com/react-fundamentals.jpg',
            description: 'How well do you know React? Take this quiz to find out.',
        },
        {
            title: 'CSS Styling',
            image: 'https://example.com/css-styling.jpg',
            description: 'Show off your CSS skills with this challenging quiz.',
        },
        // Add more quizzes as needed
    ];

    return (
        <div className="quiz-container">
            <h1>Welcome to the Home Page</h1>
            <p>Featured</p>
            {quizzes.map((quiz, index) => (
                <QuizCard
                    key={index}
                    title={quiz.title}
                    image={quiz.image}
                    description={quiz.description}
                />
            ))}
        </div>
    );
}

export default Home;
